import { StyleSheet } from "react-native";
const stylesNw = StyleSheet.create({
  container: {
    marginTop: 25,
    flexDirection: "column",
    backgroundColor: "#FFC232",
  },
  cardProduto: {
    backgroundColor: "#FF7070",
  },
});
export { stylesNw };
